import "./Expenses.css";
import ExpenseItem from "./ExpenseITem";
import Card from "../UI/Card";
import ExpensesFilter from "./ExpensesFilter";
function Expenses() {
  const saveExpenseFilterHandler = (enteredExpenseFilter) => {
    const expenseFilter = {
      ...enteredExpenseFilter,
      id: Math.random().toString(),
    };
    console.log(expenseFilter);
  };

  return (
    <div>
      <ExpensesFilter onSaveExpesnesFilter={saveExpenseFilterHandler} />

      <Card className="expenses">
        <ExpenseItem e={props.expense[0]}></ExpenseItem>
        <ExpenseItem e={props.expense[1]}></ExpenseItem>
        <ExpenseItem e={props.expense[2]}></ExpenseItem>
        <ExpenseItem e={props.expense[3]}></ExpenseItem>
      </Card>
    </div>
  );
}
export default Expenses;
